import React, { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import "../../App.css"; // Adjusted path based on new folder structure

const EditErrorsPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { selectedDocument, errorsData } = location.state || { selectedDocument: "Document 1", errorsData: {} };

  const [errorIndex, setErrorIndex] = useState(0);
  const [correctedErrors, setCorrectedErrors] = useState(0);
  const [errors, setErrors] = useState([]);
  const [manualEdit, setManualEdit] = useState("");

  useEffect(() => {
    if (errorsData) {
      let docErrors = [];
      Object.entries(errorsData).forEach(([historianName, sentences]) => {
        Object.entries(sentences).forEach(([sentence, errorArray]) => {
          if (errorArray.length > 0) {
            let modifiedText = sentence;
            let highlights = [];
            errorArray.forEach(([start, end, suggestions], index) => {
              highlights.push({
                start,
                end,
                color: index === 0 ? "red" : "orange",
              });
            });

            let formattedText = [];
            let lastIndex = 0;
            highlights.forEach(({ start, end, color }) => {
              formattedText.push(sentence.slice(lastIndex, start));
              formattedText.push(
                <span key={start} style={{ color, fontWeight: "bold" }}>
                  {sentence.slice(start, end)}
                </span>
              );
              lastIndex = end;
            });
            formattedText.push(sentence.slice(lastIndex));

            docErrors.push({
              text: formattedText,
              incorrectWord: errorArray[0][2][0],
              suggestions: errorArray[0][2],
            });
          }
        });
      });
      setErrors(docErrors);
    }
  }, [errorsData]);

  const handleNextError = () => {
    if (errorIndex < errors.length - 1) {
      setErrorIndex((prev) => prev + 1);
      setCorrectedErrors((prev) => prev + 1);
      setManualEdit("");
    } else {
      navigate("/data-storage");
    }
  };

  const handleBack = () => {
    if (errorIndex > 0) {
      setErrorIndex((prev) => prev - 1);
      setCorrectedErrors((prev) => prev - 1);
    } else {
      navigate("/error-process", { state: { selectedDocument, errorsData } });
    }
  };

  return (
    <div
      style={{
        backgroundColor: "#F0DFC3",
        fontFamily: "Proxima Nova",
        minHeight: "100vh",
        position: "relative",
        padding: "50px 100px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <h1
        style={{
          fontSize: "50px",
          fontWeight: "bold",
          color: "#A6785E",
          textAlign: "center",
          marginBottom: "50px",
        }}
      >
        Edit Document
      </h1>

      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", fontSize: "30px", color: "#50464E", marginBottom: "50px" }}>
        <p>Document: {selectedDocument}</p>
        <p>{correctedErrors}/{errors.length} current error</p>
      </div>

      <div style={{ display: "flex", gap: "50px" }}>
        {/* Document Section */}
        <div style={{ flex: 1, background: "white", padding: "20px", borderRadius: "10px", fontSize: "22px", wordBreak: "break-word" }}>
          {errors.length > 0 ? errors[errorIndex].text : "No errors found."}
        </div>

        {/* Correction Section */}
        <div style={{ flex: 1, fontSize: "30px", color: "#50464E" }}>
          <p>Error: {errors.length > 0 ? errors[errorIndex].incorrectWord : "No errors"}</p>
          <p>Suggested words:</p>
          <div style={{ display: "flex", flexDirection: "column", gap: "15px" }}>
            {errors.length > 0 && errors[errorIndex].suggestions.map((word, idx) => (
              <label key={idx} style={{ cursor: "pointer" }}>
                <input type="radio" name="suggestion" style={{ marginRight: "10px" }} />
                {word}
              </label>
            ))}
            <label style={{ cursor: "pointer" }}>
              <input type="radio" name="suggestion" style={{ marginRight: "10px" }} />
              Manual edit:
              <input
                type="text"
                value={manualEdit}
                onChange={(e) => setManualEdit(e.target.value)}
                style={{ marginLeft: "10px", padding: "5px 10px", borderRadius: "10px", border: "1px solid #A6785E" }}
              />
            </label>
          </div>
        </div>
      </div>

      <div style={{ display: "flex", justifyContent: "flex-end", gap: "25px", marginTop: "50px" }}>
        <button
          style={{ fontSize: "30px", backgroundColor: "#DEA93D", color: "#50464E", padding: "10px 30px", borderRadius: "10px", border: "none", cursor: "pointer", fontWeight: "bold" }}
          onClick={handleBack}
        >
          Back
        </button>

        <button
          style={{ fontSize: "30px", backgroundColor: "#DEA93D", color: "#50464E", padding: "10px 30px", borderRadius: "10px", border: "none", cursor: "pointer", fontWeight: "bold" }}
          onClick={handleNextError}
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default EditErrorsPage;
